import styled from "styled-components";

export const logo = styled.h1`
  width: 127px;
  height: 40px;
  left: 23px;
  top: 2282px;

  font-family: "StratosSkyeng";
  font-style: normal;
  font-weight: 600;
  font-size: 36px;
  line-height: 45px;
  display: flex;
  align-items: flex-end;
  text-transform: uppercase;

  color: rgba(0, 0, 0, 0.8);
`;
